import { StyleSheet } from "react-native";

export const stylesHome = StyleSheet.create({
    fundo: {
        width: '100%',
        height: '100%',
        backgroundColor: 'white',
    },
    containerDecima:{
        width: '100%',
        height: '40%',
        backgroundColor:'green',
        borderBottomLeftRadius: 30,
        borderBottomRightRadius: 30,
    },
    containerCategorias:{
        flex: 1,
        flexDirection:'row',
        justifyContent:'center'
    }


})
